import React from 'react';
// import App from '../../App';
import LI from "../images/lens-1418954.png"
import "../../App.css"
import { Link } from 'react-router-dom';


export default function Landing() {
  return <>
  <div className='main'>
<div className='image'>
<img src={LI} alt="landing"/>
</div>

<div className='enter'>
<h1>10x Team 04</h1>
<Link to="/enter">
<button style={{color:"#006238",padding:"8px",fontSize:"15px"}}>Enter</button>
</Link>
</div>
  </div>
  </>;
}
